import React from "react";
import DashboardLists from "./stocktaking/DashboardLists";

const DashBoardStocktaking = ({ stocktake }) => {
  return stocktake ? (
    <div>
      <h6>Stocktaking - Stocktake in Progress</h6>
    </div>
  ) : (
    <div>
      <h6>Stocktaking - Stocktake in Progress</h6>
      <DashboardLists />
    </div>
  );
};

export default DashBoardStocktaking;
